instructie:
de voetgangerszone wordt afgebakend. Het begin van de voetgangerszone wordt aangeduid;
voertuigen die in de zone moeten laden of lossen hebben eveneens toegang. De toegang is beperkt ${beperking tijd_laden en lossen};
fietsers hebben eveneens toegang

